import styled from 'styled-components';
import { useEffect } from 'react';

const FooterContainer = ({ className }) => {
	useEffect(() => {
		fetch(
			'https://api.openweathermap.org/data/3.0/onecall/timemachine?lat=39.099724&lon=-94.578331&dt=1643803200&appid=b0a91dfd4c7b661fe998b355445dcdcd',
		);
	}, []);
	return <div className={className}>Подвал страницы</div>;
};

export const Footer = styled(FooterContainer)``;
